import ExpenseDate from "./ExpenseDate";
import "./Card.css";

function Card(props) {
  return (
    <div className="card">
      <ExpenseDate date={props.item.date} />
      <div className="expense-item__description">
        <h2>{props.item.title}</h2>
        <div className="expense-item__price">${props.item.amount}</div>
      </div>
    </div>
  );
}

export default Card;
